import threading
import socketserver

class XDRServer (socketserver.ThreadingTCPServer):
#class XDRServer:
    def __init__(self, server_address, handler_class, tb, password, allow_guests=False):
        socketserver.TCPServer.__init__(self, server_address, handler_class)

        # GNU Radio block
        self.tb = tb

        # Tuner parameters
        self.tuner_mode = 0
        self.tuner_volume = 100
        self.tuner_freq = tb.get_freq()
        self.tuner_deemphasis = 0
        self.tuner_agc = 0
        self.tuner_filter = -1
        self.tuner_ant = 0
        self.tuner_gain = 0
        self.tuner_daa = 0
        self.tuner_squelch = 0
        self.tuner_rotator = 0
        self.tuner_sampling = 0
        self.tuner_detector = 0
        self.tuner_forced_mono = 0

        # Server parameters
        self.password = password

        # Internal data
        self.lock = threading.Lock()
        self.allow_guests = allow_guests
        self.users = []
        self.online = 0

    def sendall(self, data):
        for obj in self.users:
            obj.send(data+"\n")

    # Get tuner parameters
    def get_tuner_mode(self):
        return self.tuner_mode

    def get_tuner_volume(self):
        return self.tuner_volume

    def get_tuner_freq(self):
        return self.tuner_freq

    def get_tuner_deemphasis(self):
        return self.tuner_deemphasis

    def get_tuner_agc(self):
        return self.tuner_agc

    def get_tuner_filter(self):
        return self.tuner_filter

    def get_tuner_ant(self):
        return self.tuner_ant

    def get_tuner_gain(self):
        return self.tuner_gain

    def get_tuner_daa(self):
        return self.tuner_daa

    def get_tuner_squelch(self):
        return self.tuner_squelch

    def get_tuner_rotator(self):
        return self.tuner_rotator

    def get_tuner_sampling(self):
        return self.tuner_sampling

    def get_tuner_detector(self):
        return self.tuner_detector

    def get_tuner_forced_mono(self):
        return self.tuner_forced_mono


    # Set tuner parameters
    def set_tuner_mode(self, value):
        self.tuner_mode = value
        self.sendall("M"+str(value))

    def set_tuner_volume(self, value):
        self.tuner_volume = value
        self.sendall("Y"+str(value))

    def set_tuner_freq(self, value):
        self.tuner_freq = value
        self.sendall("T"+str(value))
        self.tb.set_freq(value)

    def set_tuner_deemphasis(self, value):
        self.tuner_deemphasis = value
        self.sendall("D"+str(value))
        if(value == 0):
            tau = 50e-6
        elif(value == 1):
            tau = 75e-6
        else:
            tau = 0
        self.tb.set_deemphasis(tau)

    def set_tuner_agc(self, value):
        self.tuner_agc = value
        self.sendall("A"+str(value))

