    def set_tuner_ant(self, value):
        self.tuner_ant = value
        self.sendall("Z"+str(value))

    def set_tuner_gain(self, value_rf, value_if):
        value = 10*int(bool(value_rf)) + int(bool(value_if))
        self.tuner_ant = value
        self.sendall("G"+str(value))

    def set_tuner_daa(self, value):
        self.tuner_daa = value
        self.sendall("V"+str(value))

    def set_tuner_squelch(self, value):
        self.tuner_squelch = value
        self.sendall("Q"+str(value))

    def set_tuner_rotator(self, value):
        self.tuner_rotator = value
        self.sendall("C"+str(value))

    def set_tuner_sampling(self, value_sampling, value_detector):
        self.tuner_sampling = value_sampling
        self.tuner_detector = value_detector
        self.sendall("I"+str(value_sampling)+","+str(value_detector))

    def set_tuner_forced_mono(self, value):
        self.tuner_forced_mono = value
        self.sendall("B"+str(value))
        #self.tb.set_max_interp(9999.9 if value else 2.5)
        self.tb.set_max_interp(0.0 if value else 2.5)

    # Server parameters
    def get_password (self):
        return self.password

    def get_allow_guests (self):
        return self.allow_guests

    # Users
    def add_user (self, obj):
        self.lock.acquire ()
        self.online += 1
        self.users.append (obj)
        self.sendall ("o"+str (self.online))
        self.lock.release ()

    def remove_user (self, obj):
        self.lock.acquire ()
        self.online -= 1
        self.users.remove (obj)
        for obj in self.users:
            obj.send("o"+str(self.online))
        self.lock.release ()

